const Content = (props) => {
    const title = props.title;
    const image = props.image;
    const description = props.description;
    return (
        <div>
            <img src={image} alt={title} />
            <h2>{title}</h2>
            <p>{description}</p>
        </div>
    );
}
export default Content;
